import { combineReducers } from "redux";
const UPDATE_DATA = "UPDATE_DATA";

export function updateData(data) {
  return {
    type: UPDATE_DATA,
    data,
  };
}

const defaultData = [{}];

function raw_data(state = defaultData, action) {
  switch (action.type) {
    case UPDATE_DATA:
      return [...state];
  }
}

const dataStore = combineReducers({
  data,
});

export default dataStore;
